  \"Draft final report : Relative abundance and diversity of birds in riparian habitats
  at North Platte National Wildlife refuge and in grasslands at Crescent Lake National
  Wildlife Refuge, Nebraska\",\n\t\"tracking_summary\": {\n\t\t\"total\": 1,\n\t\t\"recent\":
  1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2016-07-27T23:05:29.131945\",\n\t\"name\": \"draft-final-report-relative-abundance-and-diversity-of-birds-in-riparian-habitats-at-north\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"National Wildlife Refuges (NWRs) are among
  the few remaining tracts of land that have the potential for providing population-source
  habitats for many declining bird species. However, traditional origins and uses
  of NWRs focused on waterfowl, thus basic information about other sectors of the
  avian communities at NWRs is often insufficient for setting conservation management
  goals for passerines and other non-game birds. The overall purpose of this study
  was to establish and summarize baseline data on the relative abundances, distributions,
  and habitat associations of birds during migration/breeding seasons in riparian
  habitats of North Platte National Wildlife Refuge (NPNWR) and in grasslands of Crescent
  Lake National Wildlife Refuge (CLNWR).  A secondar goal was to assess avian abundance,
  distribution, and foraging behaviors of birds as a function of apparent habitat
  condition/ management.  The final goal was to discuss ways in which long-term monitoring
  for prairie species of concern might be conducted.\",\n\t\"license_title\": \"License
